import { Typography } from "@mui/material";
import * as React from "react";
import "./App.css";
import AddUser from "./components/AddUser";

function App() {
  return (
    <div className="App">
      <div className="nav">
        <Typography
          variant="h3"
          sx={{ fontWeight: "bold", color: "#7C1FBE ", mt: 3, mb: 6 }}
        >
          Registro de Pacientes
        </Typography>
      </div>
      <div>
        <AddUser />
      </div>
    </div>
  );
}

export default App;
